import { useGSAP } from "@gsap/react";
import gsap from "gsap";
import { ScrollTrigger } from "gsap/ScrollTrigger";
import { SplitText } from "gsap/SplitText";

const FEATURES = [
  {
    title: "Persona Scores from Community Insights",
    desc: "Your profile evolves with dynamic persona scores shaped by how others genuinely perceive and tag you.",
  },
  {
    title: "Claimable Badges",
    desc: "Earn and unlock vibrant badges based on community validation and real reputation milestones.",
  },
  {
    title: "Immutable Reviews with AI Filtering",
    desc: "All reviews are permanent and verified by AI to filter out spam and ensure credibility.",
  },
];

export function FeaturesText() {
  useGSAP(() => {
    gsap.registerPlugin(SplitText, ScrollTrigger);

    console.clear();

    gsap.set(".split", { opacity: 1 });

    document.fonts.ready.then(() => {
      let containers = gsap.utils.toArray<HTMLDivElement>(".feature");

      if (containers.length > 0) {
        console.log(containers);

        containers.forEach((container: HTMLElement) => {
          let text = container.querySelector(".desc");
          let animation;

          SplitText.create(text, {
            type: "words,lines",
            mask: "lines",
            linesClass: "line",
            autoSplit: true,
            onSplit: (instance) => {
              console.log("instances", instance);
              return gsap.from(instance.lines, {
                yPercent: 120,
                stagger: 0.1,
                scrollTrigger: {
                  trigger: container,
                  // markers: true,
                  scrub: 2,
                  // start: "clamp(top center)",
                  // end: "clamp(bottom center)",
                  start: "top 70%",
                  end: "bottom 90%",
                },
              });
            },
          });

          //
        });
      }
    });
  });

  return (
    <>
      {FEATURES.map((val, i) => (
        <div className="feature py-24 flex flex-col text-center gap-4" key={i}>
          <p className="text-4xl text-black">{val.title}</p>
          <p className="desc text-2xl text-gray-dark">{val.desc}</p>
        </div>
      ))}
    </>
  );
}

